css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document url-prefix("http://docs.google.com/Doc?"), url-prefix("https://docs.google.com/Doc?") {

#gbar,#guser,.gbh,#docs-titlebar {
display:none;
} 
#editor-menubar{
border-top:0px !important;
background-color:#202020 !important;
background-image:none !important;
padding:0px 0px 12px 15px !important;
margin-bottom:0px !important;
}
.goog-menuitem-highlight{
background-color:#D9D9D9 !important;
}

#navigation{
background-color:#202020 !important;
}
.goog-toolbar{
border-bottom:1px solid #515151 !important;
background:#202020 url(data:image/png;base64,) repeat-x scroll 0px -192px !important;
-moz-box-shadow:0px 8px 5px #202020 !important;
-webkit-box-shadow:0px 8px 5px #202020 !important;
margin-bottom:7px !important;
}
.goog-toolbar-menu-button-hover,.goog-toolbar-menu-button-open{
background-color:black !important;
}
.goog-toolbar-menu-button-outer-box,.goog-toolbar-menu-button-inner-box,.goog-toolbar-button-hover,.goog-toolbar-button-active{
border-color:black !important;
}
.goog-toolbar-menu-button-caption{
color:grey !important;
font-size:12px !important;
}
.goog-toolbar-button-outer-box,.goog-toolbar-button-inner-box{
border-color:grey !important;
}
.goog-toolbar-button-checked{
background-color:#202020 !important;
}
.goog-toolbar-separator{
border-left:1px solid #202020 !important;
border-right:1px solid grey !important;
}
.goog-toolbar-menu-button-dropdown{
background: url(data:image/png;base64,) no-repeat -388px 50% !important;
}
.goog-edit-undo{
background: url(data:image/png;base64,) no-repeat 0px 50% !important;
}
.goog-edit-redo{
background: url(data:image/png;base64,) no-repeat -16px 50% !important;
}
.goog-edit-bold{
background: url(data:image/png;base64,) no-repeat -32px 50% !important;
}
.goog-edit-italic{
background: url(data:image/png;base64,) no-repeat -48px 50% !important;
}
.goog-edit-underline{
background: url(data:image/png;base64,) no-repeat -64px 50% !important;
}
.goog-edit-foreColor{
background: url(data:image/png;base64,) no-repeat -80px 50% !important;
}
.goog-edit-backColor{
background: url(data:image/png;base64,) no-repeat -96px 50% !important;
}
.goog-edit-insertOrderedList{
background: url(data:image/png;base64,) no-repeat -176px 50% !important;
}
.goog-edit-insertUnorderedList{
background: url(data:image/png;base64,) no-repeat -160px 50% !important;
}
.goog-edit-outdent{
background: url(data:image/png;base64,) no-repeat -144px 50% !important;
}
.goog-edit-indent{
background: url(data:image/png;base64,) no-repeat -128px 50% !important;
}
.goog-edit-justifyLeft{
background: url(data:image/png;base64,) no-repeat -192px 50% !important;
}
.goog-edit-justifyCenter{
background: url(data:image/png;base64,) no-repeat -208px 50% !important;
}
.goog-edit-justifyRight{
background: url(data:image/png;base64,) no-repeat -224px 50% !important;
}
.goog-edit-spell{
background: url(data:image/png;base64,) no-repeat -272px 50% !important;
}
.close_box,.goog-find-close{
background: url(data:image/png;base64,) no-repeat -784px 50% !important;
}

.editBorder{
border:0px !important;
}
.pageview{
background-color:#404040 !important;
}
.editor{
margin:15px auto 25px 15px !important;
-moz-box-shadow:4px 4px 4px #292929 !important;
-webkit-box-shadow:4px 4px 4px #292929 !important;
}

.modal-dialog,.sketchy-dialog{
border:1px solid grey !important;
-moz-border-radius:4px !important;
-webkit-border-radius:4px !important;
-moz-box-shadow:4px 4px 4px grey !important;
-webkit-box-shadow:4px 4px 4px grey !important;
background-color:black !important;
color:white !important;
}
.modal-dialog-title,.sketchy-dialog-title{
background-color:black !important;
}
.modal-dialog-content{
color:black !important;
}

.editWarning{
background-color:black !important;
-moz-border-radius:0 0 0 4px !important;
-webkit-border-radius:0 0 0 4px !important;
}
}
